import { Notifications } from 'expo';

export default function notificationChannelInit(){
    if (Platform.OS === 'android') {
      Notifications.createChannelAndroidAsync('reminders', {
      name: 'Reminders',
      priority: 'max',
      sound: true,
      vibrate: [250, 250, 250, 250],
      });
    }
  }
